import './App.css';
import FileIcons from './FileIcons';
import FileUpload from './FileUpload';

function App() {
  return (
    <div className="App">
      <div className="header">
        <img class="logo" src="https://ssl.gstatic.com/images/branding/product/1x/drive_2020q4_48dp.png" width="40px" height="40px" alt="test" />
        <div className="header__text">Drive</div>
      </div>
      <div className="body">
        <FileUpload />
        <FileIcons />
        <FileUpload />
      </div>
    </div>
  );
}

export default App;
